import React from "react";
import { Link } from "react-router-dom";

const Home = () => {

    return (
        <>

            <div class="main">
            <div class="row header shadow-sm p-3 mb-5 bg-body rounded">
                <div class="container">
                    <img src={require('./img/logo.png')}/>
                </div>
            </div>
            </div>
            

        </>

    )

}

export default Home
